import React, { useEffect, useState } from "react";

const ErrorForm = ({ msg, removeItem }) => {
    console.log(msg);
    return !Array.isArray(msg)
        ? null
        : msg.map((item, index) => (
              <div key={index} className="msg">
                  <i className="fa fa-check-circle" />
                  <div className="wrap-ms">
                      <span className="wrap-ms-title">Sucess</span>
                      <span className="wrap-ms-content">{item}</span>
                  </div>
                  <i
                      className="fa fa-times"
                      onClick={() => removeItem(index)}
                  ></i>
              </div>
          ));
};

const handleRender = (preMome, nextMemo) => {
    return nextMemo != null;
};

export default ErrorForm;

export const MemoErrorForm = React.memo(ErrorForm, handleRender);
